import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById("root"));

const el = (
    <>
    <h1><span>Hello World!!</span></h1>;

    </>
);

const AppList = () => {
    return (
    <ul>
        <li>Мой первый компонент</li>
        <li>Мой второй компонент</li>
    </ul>
    )
}

console.log(el);

root.render(el);
